import React from 'react';

const Navbar = () => {
    return (
        <nav style={navStyle}>

            <ul style={ulStyle}>
                <li style={liStyle}>
                    <h1 style={headStyle}>COUNT-IT</h1>
                </li>
                <li style={liStyle}><a href='/'>Home</a></li>
                <li style={liStyle}><a href='/yourInventory'>Your Inventory</a></li>
                <li style={liStyle}><a href='/store'>Store</a></li>
                <li style={liStyle}><a href='/about'>About us</a></li>
                <li style={liStyle}><a href='/yourProfile'>Your Profile</a></li>
            </ul>
        </nav>
    )
};

const navStyle ={
    backgroundColor: 'white',
    borderBottom: '2px solid #00308F',
    fontWeight: '900',
    fontSize : '18px',
    padding: '5px',
}

const ulStyle = {
    listStyle : 'none',
    display: 'flex',
    justifyContent: 'space-around',
    margin: '0',
    padding: '0'
}

const liStyle = {
    display: 'inline',
    color: 'white',
    textDecoration: 'none'
}

const imgStyle = {
    height: '30px',
    width: '30px'
}


export default Navbar;
